import { UserContext } from "../App";

export default function Skill(){

    const user = useContext(UserContext)
    console.log(user.skills)

    return(

        <>
        <h1> {user.skills[1]}</h1>
        {user.skills.map((skill) => (
           <li>
            {skill}
           </li> 
        ))}
        </>
    )

}
